import React from 'react'
import ReactDOM from 'react-dom/client'
// import './index.css'
import './main.scss';
// import 'bootstrap/dist/css/bootstrap.min.css';
import App from './App'
import { AppProvider } from './globalContext'

const root = ReactDOM.createRoot(document.querySelector('#root'))
root.render(
  <AppProvider>
          <App />    
  </AppProvider>
)
